import React from 'react';
import ReactDOM from 'react-dom';
import Card from "./Card";
import "./index.css";
import sdata from "./sdata";
const studentdata = [{id:1,name:"vinod",degree:"mcs"},
                     {id:2,name:"thapa",degree:"sc"},
                     {id:3,name:"thapatechnical",degree:"m.tech"}
                    ]
const newdata = studentdata.map((cvalue)=>{
  return `my name is ${cvalue.name}, my highest degree is ${cvalue.degree} <br/>`;
});



ReactDOM.render(
  <>
  <h1 className="heading_style">List of top 5 songs in 2020 {newdata}</h1>
  <Card 
  imgsrc =  {sdata[0].imgSrc}
  title  =  {sdata[0].title}  
  sname  =  {sdata[0].sname}  
  link   =  {sdata[0].link}  />

  <Card 
  imgsrc =  {sdata[1].imgSrc}
  title  =  {sdata[1].title}  
  sname  =  {sdata[1].sname}  
  link   =  {sdata[1].link}  />

  <Card 
  imgsrc =  {sdata[2].imgSrc}
  title  =  {sdata[2].title}  
  sname  =  {sdata[2].sname}  
  link   =  {sdata[2].link}  />

  <Card 
  imgsrc =  {sdata[3].imgSrc}
  title  =  {sdata[3].title}  
  sname  =  {sdata[3].sname}  
  link   =  {sdata[3].link}  />

  <Card 
  imgsrc =  {sdata[4].imgSrc}
  title  =  {sdata[4].title}  
  sname  =  {sdata[4].sname}  
  link   =  {sdata[4].link}  />



  </>
  ,document.getElementById('root')
);
